const defaultProps = {
  maxlength: UsaCharacterCount.props.maxlength.default,
  id: UsaCharacterCount.props.id.default,
}

export default {
  component: UsaCharacterCount,
  title: 'Components/UsaCharacterCount',
  argTypes: {
    maxlength: {
      control: { type: 'number' },
    },
    id: {
      control: { type: 'text' },
    },
    default: {
      control: { type: 'text' },
    },
    'equal-message': {
      control: { type: 'text' },
    },
    'remaining-message': {
      control: { type: 'text' },
    },
    'over-message': {
      control: { type: 'text' },
    },
  },
  args: {
    maxlength: defaultProps.maxlength,
    id: defaultProps.id,
    default: '',
    'equal-message': '',
    'remaining-message': '',
    'over-message': '',
  },
}

